    [],nt"num_tags": 13,nt"name": "driftless-area-national-wildlife-refuge-annual-narrative-report-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Driftless
    Area National Wildlife Refuge summarizes refuge activities during the 1992 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition - including fee titles and easements topics are also
    covered.  The report includes a planning section which discusses refuge management
    plans and research.  Refuge administration is outlined; information about personnel,
    refuge programs, funding and safety is given.  Habitat management is also covered.
     Subjects include croplands, other habitats, and pest control.  The wildlife section
    of the report discusses endangered or threatened species.  The public uses of the
    refuge described in this report include interpretive programs, hunting, off-road
    vehicling, and law enforcement.  The equipment and facilities section of the report
    provides information about new construction, maintenance, and communications systems.
     Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
